import React from 'react';

const EventList = (props) => {

    const events =  props.events.map((event, i)=> {



            return (
                        <li key = {i} style="list-style: none">
                               <h5>{event.displayName} </h5>
                        </li>

                    )



    })

    return(
        <div>
            <h1>{events}</h1>
        </div>
    )





}

export default EventList;
